INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (100101, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ", "人助け、応援", 16, 155, "トゥインクルウィッシュ", "東山奈央", 8, 44, 27, "人助けが大好き！　前向き格闘娘", "獣人族", 2, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (100201, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ", "料理、人間観察", 17, 158, "トゥインクルウィッシュ", "種田梨沙", 4, 47, 5, "戦闘のサポートが得意な、心優しい少女", "ヒューマン", 2, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (100301, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ", "読書、乗馬、お茶", 18, 163, "トゥインクルウィッシュ", "早見沙織", 1, 46, 12, "クールで何事にも真っ直ぐな剣士", "魔族", 2, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (100401, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "ミソギ", "いたずら、探検", 9, 128, "リトルリリカル", "諸星すみれ", 8, 27, 10, "探検好きのイタズラっ子", "ヒューマン", 5, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (100501, "？？？", "マツリ", "ヒーローごっこ", 12, 146, "王宮騎士団（NIGHTMARE）", "下田麻美", 11, 40, 25, "ヒーローに憧れる騎士見習いの少女", "獣人族", 8, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (100601, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "アカリ", "サックス", 13, 150, "悪魔偽王国軍（ディアボロス）", "浅倉杏美", 11, 42, 22, "甘え上手なみんなの人気者", "魔族", 7, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (100701, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ", "プリンを食べること", 14, 130, "悪魔偽王国軍（ディアボロス）", "雨宮天", 1, 32, 23, "プリン大好きゴースト娘", "魔族", 7, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (100801, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ユキ", "鏡で自分を見ること", 14, 150, "ヴァイスフリューゲル　ランドソル支部", "大空直美", 10, 40, 10, "ボクは誰よりも美しい", "エルフ", 15, 0, "AB");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (100901, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "アンナ", "小説執筆", 17, 159, "トワイライトキャラバン", "髙野麻美", 7, 45, 5, "前世を信じる中二病患者、「疾風の冥姫」", "魔族", 13, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (101001, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "マホ", "空想、ぬいぐるみ集め", 16, 155, "自警団（カォン）", "内田真礼", 9, 42, 22, "マホマホ王国のプリンセス", "獣人族", 10, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (101101, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "リノ", "お裁縫", 15, 156, "ラビリンス", "阿澄佳奈", 8, 44, 25, "人懐っこくてマシンガントークな妹系少女", "ヒューマン", 3, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (101201, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "ハツネ", "妹と遊ぶこと、二度寝、昼寝、早寝", 17, 156, "フォレスティエ", "大橋彩香", 12, 46, 24, "みんなのために超能力を使う眠り姫", "エルフ", 6, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (101301, "", "ナナカ", "読書、魔法", 18, 166, "トワイライトキャラバン", "佳村はるか", 8, 55, 21, "オタク全開な魔法少女", "魔族", 13, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (101401, "test", "カスミ", "読書、推理", 15, 152, "自警団（カォン）", "水瀬いのり", 11, 41, 3, "頭脳明晰な美少女名探偵", "獣人族", 10, 0, "AB");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (101501, "test", "ミサト", "絵本作り", 21, 165, "フォレスティエ", "國府田マリ子", 9, 54, 5, "母性溢れる優しいみんなの「ミサト先生」", "エルフ", 6, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (101601, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "スズナ", "ファッション", 18, 167, "ルーセント学院", "上坂すみれ", 4, 48, 10, "天真爛漫で人気者のカリスマモデル", "魔族", 14, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (101701, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "カオリ", "踊り、空手", 19, 158, "自警団（カォン）", "高森奈津美", 7, 53, 7, "いつでも「なんくるないさ～」な天然娘", "獣人族", 10, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (101801, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "イオ", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 23, 162, "ルーセント学院", "伊藤静", 8, 52, 14, "多くの男性を魅了する無垢な女教師", "魔族", 14, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (102001, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "ミミ", "かわいいもの集め", 10, 117, "リトルリリカル", "日高里菜", 4, 21, 3, "お歌もにんじんも、ウサギさんも大好き♪", "獣人族", 5, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (102101, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ", "観劇、おままごと", 12, 150, "サレンディア救護院", "植田佳奈", 6, 40, 9, "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", 9, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (102201, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "ヨリ", "ゲーム全般", 13, 150, "悪魔偽王国軍（ディアボロス）", "原紗友里", 11, 40, 22, "人見知りであまのじゃくな女の子", "魔族", 7, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (102301, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ", "屋内でできる遊び", 14, 148, "サレンディア救護院", "芹澤優", 5, 38, 10, "ぷうきちといつも一緒！", "ヒューマン", 9, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (102501, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "スズメ", "ご奉仕", 15, 154, "サレンディア救護院", "悠木碧", 12, 43, 12, "お嬢さまのためにがんばるドジっ娘メイド", "ヒューマン", 9, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (102601, "test", "リン", "あんパン", 17, 144, "牧場（エリザベスパーク）", "小岩井ことり", 1, 42, 1, "遊びと睡眠が何より大事なぐうたら娘", "獣人族", 11, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (102701, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ", "実験、裁縫、料理", 16, 154, "トワイライトキャラバン", "橋本ちなみ", 7, 43, 30, "運命の相手に一途すぎる乙女", "魔族", 13, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (102801, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "サレン", "経営、お茶会", 17, 156, "サレンディア救護院", "堀江由衣", 10, 43, 4, "救護院を経営する優しい庶民派お嬢様", "エルフ", 9, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (102901, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "ノゾミ", "舞台鑑賞、ダンス", 17, 157, "カルミナ", "日笠陽子", 1, 40, 24, "歌って踊れる大人気アイドル", "ヒューマン", 4, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (103001, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ニノン", "忍法開発", 16, 163, "ヴァイスフリューゲル　ランドソル支部", "佐藤聡美", 8, 51, 31, "トーゴクの神秘、オシエテクダサイ！", "ヒューマン", 15, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (103101, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "シノブ", "占い", 18, 157, "悪魔偽王国軍（ディアボロス）", "大坪由佳", 12, 42, 22, "占いが得意な霊能少女", "魔族", 7, 0, "AB");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (103201, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "アキノ", "慈善事業", 18, 157, "メルクリウス財団", "松嵜麗", 3, 45, 12, "一人前の商人を目指すパワフルお嬢様", "ヒューマン", 12, 0, "AB");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (103301, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "マヒル", "漫才", 20, 142, "牧場（エリザベスパーク）", "新田恵海", 3, 35, 3, "みんなを笑顔にするお笑い牧場主", "ヒューマン", 11, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (103401, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "ユカリ", "ウインドーショッピング", 22, 164, "メルクリウス財団", "今井麻美", 3, 55, 16, "純情でほっとけない大人の女性", "エルフ", 12, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (103601, "test", "キョウカ", "お勉強", 8, 118, "リトルリリカル", "小倉唯", 2, 21, 2, "礼儀正しくしっかり者のちびっ子優等生", "エルフ", 5, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (103701, "test", "トモ", "剣術、年長者をからかう", 13, 149, "王宮騎士団（NIGHTMARE）", "茅原実里", 8, 43, 11, "義理堅くてからかい好きな剣術少女", "ヒューマン", 8, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (103801, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "シオリ", "読書、お散歩", 14, 153, "牧場（エリザベスパーク）", "小清水亜美", 11, 40, 3, "読書が趣味の病弱少女", "獣人族", 11, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (104001, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "アオイ", "友達作りのイメトレ", 13, 158, "フォレスティエ", "花澤香菜", 6, 44, 6, "「友達」に憧れる、エルフの森の女の子", "エルフ", 6, 0, "AB");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (104201, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ", "各種楽器", 17, 163, "カルミナ", "福原綾香", 6, 46, 3, "人々を守るために歌う、唱喚士の少女", "ヒューマン", 4, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (104301, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "マコト", "お菓子作り", 17, 168, "自警団（カォン）", "小松未可子", 8, 54, 9, "男勝りで情に厚いワイルド娘", "獣人族", 10, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (104401, "test", "イリヤ", "世界征服", "??", 172, "悪魔偽王国軍（ディアボロス）", "丹下桜", 5, 50, 5, "かつては夜を支配した最強の吸血鬼", "魔族", 7, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (104501, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "クウカ", "小説を読むこと", 18, 157, "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", 11, 49, 19, "妄想大好き！　ほんとは照れ屋な女の子", "ヒューマン", 15, 0, "AB");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (104601, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "タマキ", "猫とたわむれること", 18, 158, "メルクリウス財団", "沼倉愛美", 3, 48, 1, "弱きを助け強きをくじく猫娘", "獣人族", 12, 0, "AB");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (104701, "？？？", "ジュン", "格闘技、湯浴み", 25, 171, "王宮騎士団（NIGHTMARE）", "川澄綾子", 10, 50, 25, "素顔を見せない冷静沈着な女性騎士", "ヒューマン", 8, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (104801, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ミフユ", "傭兵などのアルバイト", 20, 163, "メルクリウス財団", "田所あずさ", 11, 49, 11, "仕事も私事も効率優先な傭兵少女", "ヒューマン", 12, 0, "O");
