INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (107701, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "スズメ（サマー）", "ご奉仕", 15, 154, "サレンディア救護院", "悠木碧", 12, 43, 12, "お嬢さまのためにがんばるドジっ娘メイド", "ヒューマン", 9, 0, "O");
