INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (107901, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "タマキ（サマー）", "猫とたわむれること", 18, 158, "メルクリウス財団", "沼倉愛美", 3, 48, 1, "弱きを助け強きをくじく猫娘", "獣人族", 12, 0, "AB");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (108001, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ミフユ（サマー）", "傭兵などのアルバイト", 20, 163, "メルクリウス財団", "田所あずさ", 11, 49, 11, "仕事も私事も効率優先な傭兵少女", "ヒューマン", 12, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (108101, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "シノブ（ハロウィン）", "占い", 18, 157, "悪魔偽王国軍（ディアボロス）", "大坪由佳", 12, 42, 22, "占いが得意な霊能少女", "魔族", 7, 0, "AB");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (108201, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ（ハロウィン）", "プリンを食べること", 14, 130, "悪魔偽王国軍（ディアボロス）", "雨宮天", 1, 32, 23, "プリン大好きゴースト娘", "魔族", 7, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (108301, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ミサキ（ハロウィン）", "ファッション誌鑑賞、コスメ集め", 11, 120, "ルーセント学院", "久野美咲", 1, 22, 3, "ちょっとおませな恋に恋する女の子", "魔族", 14, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (108401, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ（クリスマス）", "各種楽器", 17, 163, "カルミナ", "福原綾香", 6, 46, 3, "人々を守るために歌う、唱喚士の少女", "ヒューマン", 4, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (108501, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ（クリスマス）", "観劇、おままごと", 12, 150, "サレンディア救護院", "植田佳奈", 6, 40, 9, "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", 9, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (108601, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ（クリスマス）", "屋内でできる遊び", 14, 148, "サレンディア救護院", "芹澤優", 5, 38, 10, "ぷうきちといつも一緒！", "ヒューマン", 9, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (108701, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ（ニューイヤー）", "人助け、応援", 16, 155, "トゥインクルウィッシュ", "東山奈央", 8, 44, 27, "人助けが大好き！　前向き格闘娘", "獣人族", 2, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (108801, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ（ニューイヤー）", "料理、人間観察", 17, 158, "トゥインクルウィッシュ", "種田梨沙", 4, 47, 5, "戦闘のサポートが得意な、心優しい少女", "ヒューマン", 2, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (108901, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ（ニューイヤー）", "読書、乗馬、お茶", 18, 163, "トゥインクルウィッシュ", "早見沙織", 1, 46, 12, "クールで何事にも真っ直ぐな剣士", "魔族", 2, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (109001, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ（バレンタイン）", "実験、裁縫、料理", 16, 154, "トワイライトキャラバン", "橋本ちなみ", 7, 43, 30, "運命の相手に一途すぎる乙女", "魔族", 13, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (109101, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "シズル（バレンタイン）", "家事全般", 18, 168, "ラビリンス", "生天目仁美", 10, 54, 24, "お姉ちゃんがお世話してあげるからねっ！", "ヒューマン", 3, 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (109201, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "アン", "読書", 17, 156, "？？？", "日笠陽子", 12, 55, 1, "英霊と契約を結んだマナリアの天才王女", "ヒューマン", "", 0, "AB");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (109301, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "ルゥ", "食べること、眠ること", 15, 144, "？？？", "こやまきみこ", 2, 45, 4, "マナリア魔法学院の新入生", "ヒューマン", "", 0, "O");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (109401, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "グレア", "ピアノ", 17, 167, "？？？", "福原綾香", 11, 67, 3, "人を超越した力を有す心優しい竜姫", "半人半竜", "", 0, "B");
