INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (117601, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ユキ（オーエド）", "鏡で自分を見ること", 14, 150, "ヴァイスフリューゲル　ランドソル支部", "大空直美", 10, 40, 10, "ボクは誰よりも美しい", "エルフ", 15, 0, "AB");
