INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (121901, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "アンナ（パイレーツ）", "小説執筆", 17, 159, "トワイライトキャラバン", "髙野麻美", 7, 45, 5, "前世を信じる中二病患者、「疾風の冥姫」", "魔族", 13, 0, "A");
