INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (122201, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "ユカリ（キャンプ）", "ウインドーショッピング", 22, 164, "メルクリウス財団", "今井麻美", 3, 55, 16, "純情でほっとけない大人の女性", "エルフ", 12, 0, "A");
