INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (122401, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ（サマー）", "人助け、応援", 16, 155, "トゥインクルウィッシュ", "東山奈央", 8, 44, 27, "人助けが大好き！　前向き格闘娘", "獣人族", 2, 0, "A");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (122501, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ（サマー）", "読書、乗馬、お茶", 18, 163, "トゥインクルウィッシュ", "早見沙織", 1, 46, 12, "クールで何事にも真っ直ぐな剣士", "魔族", 2, 0, "B");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (122601, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ（サマー）", "料理、人間観察", 17, 158, "トゥインクルウィッシュ", "種田梨沙", 4, 47, 5, "戦闘のサポートが得意な、心優しい少女", "ヒューマン", 2, 0, "O");
